import React from "react";
import CompletedRequests from "../components/layout/CompletedRequests";
import DoctorMenu from "../components/layout/DoctorMenu";
import InQueueReuests from "../components/layout/InQueueReuests";
const RecentEvaluation2 = () => {
  return (
    <DoctorMenu>
      <div className="p-3 evaluation-buttons-cont">
        <button className="bt-2 bt-3">Completed Requests</button>
        <button className="bt-2">In-Queue Requests</button>
        <InQueueReuests />
        <CompletedRequests />
      </div>
    </DoctorMenu>
  );
};

export default RecentEvaluation2;
